import React from 'react';
import ReactDOM from 'react-dom'
import './index.css'

const that = "Pranesh kumar shukla"
const img1="https://picsum.photos/200/300" 
const img2="https://picsum.photos/300/300" 
const img3="https://picsum.photos/400/300" 
const myWeb= "https://affairsworld.com"
// .heading{
//     color:blue;
//     text-align: center;
//     text-transform: uppercase;
//     font-weight: 900;
//     text-shadow: 0px 2px 4px grey;
// }
const heading = {
    color:'#fa9191',
    textTransform: 'capitalize',
    textAligen:'center'
}

ReactDOM.render(
<>
<h1 style={{ color:'#fa9191',textTransform: 'capitalize',textAligen:'center'
} } >My name is {that}</h1>
<div className="img-div">
<img src={img1}
alt="Nature Random Images"/>
<img src={img2}
alt="Nature Random Images"/>

<a href={myWeb} target="_blank">
<img src={img3}
alt="Nature Random Images"/>
</a>
</div>
</>,document.getElementById("root"));
